import React from 'react'
import um from './Users.module.css'

const Users = (props) => {
    return (

        props.Users.map(us => <div key={us.id} className={um.Main}>
           <div >
            <img className={um.img} src={us.avalink}/>
           <div>
               <button className={um.button} >
               Follow
               </button>
           </div>
           </div>
            <div className={um.Names}>
                {us.name}
                <div className={um.Posts}>
                    {us.status}
                </div>
            </div>
            <div className={um.Country}>
                {us.location.country}
                {','}
                <div className={um.City}>
                    {us.location.city}
                </div>
            </div>
        </div>)
    )
}
export default Users
